import {useState} from 'react'
import NotFound from './components/NotFound'

function App()  {
  const [status, changeStatus] = useState(false)
  return (
    <BrowserRouter>
      <Routes>
        <Route path = "/" exact component = {<Home/>}/>
        <Route component = {<NotFound/>} />
      </Routes>
    </BrowserRouter>
  );
}

